import React from 'react';
import RedBox from './RedBox';
import GrabStocks from './GrabStocks';
import { useTotalAmount } from './context/TotalAmountContext';
import Typewriter from 'typewriter-effect';

import styled from 'styled-components';

const StyledTypewriter = styled(Typewriter)`
  color: #28464B;
  font-size: 32px;
  text-align: left;
  padding-left: 20px;
`;

function NetWorth() {
  // const { header } = props
  const vooStockAmount = 2.91097;
  const googlStockAmount = 5;
  const pltrStockAmount = 15;
  const { totalAmount } = useTotalAmount();

  return (
    <>
      <div className="net-worth">
        <GrabStocks
          vooStockAmount={vooStockAmount}
          googlStockAmount={googlStockAmount}
          pltrStockAmount={pltrStockAmount}
        />
        <RedBox leftText="Net Worth:" rightText={totalAmount === 0 ? ('Calculating...') : (`$${totalAmount}`)} />
        <h1 style = {{ color: '#28464B', fontSize: '54px' , textAlign: 'left', paddingLeft: '15px'}}>Welcome Bennett!</h1>
        <h1 style = {{ color: '#28464B', fontSize: '32px' , textAlign: 'left', paddingLeft: '20px'}}>How can I help you today?</h1>
      </div>
    </>
  );
}

export default NetWorth;
